function Footer() {
  return (
    <footer className="bg-[#111] text-center text-white py-6">
      <p className="text-sm sm:text-base">
        &copy; {new Date().getFullYear()} ConVINCE Team | All rights reserved.
      </p>
    </footer>
  );
}

export default Footer;
